import logo from "./logo.svg";
import articles from "./hackerNoonArticles";
import { Header } from "./Header";
import { Body } from "./Body";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <Body />


      </header>
    </div>
  );
}

export default App;

//extras
<img src={logo} className="App-logo" alt="logo" />

